import React, { useEffect, useState } from "react";
import "./HomePage.css";
import News from "../News/News";
const HomePage = ({ user, search, newsData, setNews }) => {
  const { userName } = user;
  const firstName = userName.split(" ").slice(0, 1);
  const apiKey = "ef7fd608-e4ba-4e7d-b63c-8fcc4fd8f9f1";
  useEffect(() => {
    async function getNews() {
      let response = await fetch(
        `https://content.guardianapis.com/search?show-elements=image&api-key=${apiKey}`
      );
      const data = await response.json();
      setNews(data.response.results);
      console.log(newsData);
    }
    getNews();
  }, []);
  return (
    <div>
      <header>Welcome {firstName}!</header>
      <main>
        <h2>Top Stories</h2>
        <News newsData={newsData} />
      </main>
    </div>
  );
};

export default HomePage;
